taskSetItem.script2:
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32(); 

es.logWarning("pc::"+pageCurrent);

var EnterInTime = eio.readString8();  
es.logWarning(EnterInTime);
var EnterOutTime = eio.readString8();  
es.logWarning(EnterOutTime);
var StartInTime = eio.readString32();
var StartOutTime = eio.readString32(); 
var tel = eio.readString16();
var shenfenId = eio.readString32();  
var Car = eio.readString16(); 

var condition = "where 1=1";
if(EnterInTime != "" &amp;&amp; EnterOutTime != ""){
    //condition += " and ujia_code.create_time > "+db.encode(EnterInTime)); 
    condition += " and ujia_code.create_time between '"+
            db.encode(EnterInTime)+"' and '"+db.encode(EnterOutTime)+"'";  
    es.logWarning(condition);
}       
if(StartInTime != "" &amp;&amp; StartOutTime != ""){
       condition += " and ujia_code.validdate between '"+
            db.encode(StartInTime)+"' and '"+db.encode(StartOutTime)+"'"; 
    //es.logWarning("StarInTime:"+StarInTime);
}   


if(tel != ""){
    condition += " and ujia_order.tel = '"+db.encode(tel)+ "' ";
    es.logWarning("cccc  "+condition);  
}                                           
if(shenfenId != ""){
    condition += " and ujia_order.idcard = "+shenfenId;
}                                                      
if(Car != ""){
    condition += " and ujia_order.location = "+Car;
}

var sql, sqlResult;
//获取记录数量
sql = "select count(*) as c from ujia_scan "+
     "inner JOIN ujia_code on ujia_scan.barcode=ujia_code.barcode "+
     "inner JOIN ujia_order on ujia_code.orderid=ujia_order.orderid "+
     condition;    

sqlResult=db.executeQuery("UJ", sql);      

db.read(sqlResult);       
var count = db.getString(sqlResult,"c");
//读取表   
sql = "SELECT ujia_scan.barcode,ujia_order.location,ujia_order.pay_money," +
    "ujia_scan.in_time,ujia_scan.out_time,"+
    "ujia_scan.out_time-ujia_scan.in_time as sc,"+
    "ujia_scan.overtime_money,"+
    "ujia_order.pay_money+ujia_scan.overtime_money as sm,"+
    "ujia_scan.status,ujia_order.mid " +
    "from ujia_scan "+
     "inner JOIN ujia_code on ujia_scan.barcode=ujia_code.barcode "+
     "inner JOIN ujia_order on ujia_code.orderid=ujia_order.orderid "+
    condition +" order by ujia_code.validdate desc";
sqlResult = db.executeQuery("UJ", sql);  
eio.appendInt32(count);
eio.appendDataSet(sqlResult, "barcode,location,pay_money,in_time,out_time,sc,overtime_money,sm,status,mid", pageSize*(pageCurrent-1), pageSize);

sql = "SELECT sum(ujia_order.pay_money) as PM,sum(ujia_scan.overtime_money) as OM,sum(ujia_order.pay_money+ujia_scan.overtime_money) as MM "+
     "from ujia_scan "+
     "inner JOIN ujia_code on ujia_scan.barcode=ujia_code.barcode "+
     "inner JOIN ujia_order on ujia_code.orderid=ujia_order.orderid "+
    condition +" order by ujia_code.validdate desc";   
//es.logWarning(sql);
sqlResult = db.executeQuery("UJ", sql);  
db.read(sqlResult); 
var PM = db.getString(sqlResult,"PM");//应收
var OM = db.getString(sqlResult,"OM");//加收
var MM = db.getString(sqlResult,"MM");//总
eio.appendString16(MM);
eio.appendString16(PM);
eio.appendString16(OM);

